import './App.css';

//todolist container and create todolist
import { TodoListContainer} from './components/todolist';


function App() {
  return (
    <div className="App">
      <h1 className='grid'>To-Do List</h1>
      <TodoListContainer />
    </div>
  );
}

export default App;
